import { HashRouter, Redirect, Route, Switch } from "react-router-dom";
import { GlobalStyle } from "./GlobalStyle";

import { Main } from "../common/Main";
import { Footer } from "../common/Footer";
import { Top } from "../common/Top/Top";
import { Renowacja } from "../features/AboutUs/renowacja-felg/renowacja";
import { SocialSection } from "../common/Socials/SocialSection";
import { Tiles } from "../common/Top/Tiles";

function App() {
  return (
    <>
      <GlobalStyle />
      <HashRouter>
        <Top />
        <Main>
          <Switch>
            <Route path="/renowacja-felg">
              <Renowacja />
            </Route>
             <Route path="/strona-glowna">
               <Tiles/>
               </Route>
            <Route path="/">
              <Redirect to="/strona-glowna" />
            </Route>
            
          </Switch>
        </Main>
        <SocialSection/>
        <Footer />
      </HashRouter>
    </>
  );
}

export default App;
